/**
 * a simple function that offers the same interface
 * for both Map and object key interation.
 * @private
 */
export default function foreach(col, f) {
  if (!col) {
    return;
  }
  if (col instanceof Map) {
    col.forEach(f);
  } else {
    Object.getOwnPropertyNames(col).forEach((k) => f(col[k], k));
  }
};

