/**
 * @module
 */
import * as superagent from 'superagent';

const libhoney_js_version = "LIBHONEY_JS_VERSION";

// default triggers for sending a batch:
const batchSizeTrigger = 100; // either when the eventQueue is > this length
const batchTimeTrigger = 100; // or it's been more than this many ms since the first push

const emptyResponseCallback = function() { };

/**
 * @private
 */
export default class Transmission {

  constructor (options) {
    this._responseCallback = emptyResponseCallback;
    this._batchSizeTrigger = batchSizeTrigger;
    this._batchTimeTrigger = batchTimeTrigger;
    this._sendTimeoutId = -1;
    this._eventQueue = [];

    if (typeof options.responseCallback == "function") {
      this._responseCallback = options.responseCallback;
    }
    if (typeof options.batchSizeTrigger == "number") {
      this._batchSizeTrigger = options.batchSizeTrigger;
    }
    if (typeof options.batchTimeTrigger == "number") {
      this._batchTimeTrigger = options.batchTimeTrigger;
    }
  }

  sendEvent (ev) {
    // bail early if we aren't sampling this event
    if (!this._shouldSendEvent(ev)) {
      return;
    }

    this._eventQueue.push(ev);
    if (this._eventQueue.length > this._batchSizeTrigger) {
      this._sendBatch();
    } else {
      this._ensureSendTimeout();
    }
  }

  _sendBatch () {
    this._clearSendTimeout();

    var batch = this._eventQueue.splice(0, this._batchSizeTrigger);

    for (var ev of batch) {
      var url = ev.apiHost + "/1/events/" + ev.dataset;
      var req = superagent.post(url);
      req
        .set('X-Hny-Team', ev.writeKey)
        .set('X-Hny-Samplerate', ev.sampleRate)
        .set('X-Hny-Event-Time', ev.timestamp.toISOString())
        .set('User-Agent', `libhoney-js/${libhoney_js_version}`)
        .type("json")
        .send(ev.postData)
        .end((err, res) => {
          // call a callback here (in our init options) so it can be used both in the node, browser, and worker contexts.
          this._responseCallback({ stuff: "goes here" }); // XXX(toshok)
        });
    }
  }

  _shouldSendEvent (ev) {
    var { sampleRate } = ev;
    if (sampleRate <= 1) {
      return true;
    }
    return (Math.random() >= 1/sampleRate);
  }

  _ensureSendTimeout () {
    if (this._sendTimeoutId === -1) {
      this._sendTimeoutId = setTimeout(() => this._sendBatch(), this._batchTimeTrigger);
    }
  }

  _clearSendTimeout () {
    if (this._sendTimeoutId !== -1) {
      clearTimeout(this._sendTimeoutId);
      this._sendTimeoutId = -1;
    }
  }
}

import assert from 'assert';
import libhoney from '../lib/libhoney';

describe('libhoney builder', function() {
  var hny = new libhoney();

  it("takes fields and dynamic fields in ctor", function() {
    var b = hny.newBuilder({a : 5}, {b: function() { return 3; }});
    assert.equal(5, b._fields.a);
    assert.equal(undefined, b._fields.b);
    b = hny.newBuilder();
    assert.equal(0, Object.getOwnPropertyNames(b._fields).length);
    assert.equal(0, Object.getOwnPropertyNames(b._dyn_fields).length);
  });

  it("accepts dict-like arguments to .add()", function() {
    var b;
    var ev;

    b = hny.newBuilder();
    b.add({ a: 5 });
    ev = b.newEvent();
    assert.equal(5, ev.data.a);

    var map = new Map();
    map.set("a", 5);
    b = hny.newBuilder();
    b.add(map);
    ev = b.newEvent();
    assert.equal(5, ev.data.a);
  });
});

import assert from 'assert';
import libhoney from '../lib/libhoney';

describe('libhoney events', function() {
  var hny = new libhoney();

  it("inherit fields and dyn_fields from builder", function() {
    var b = hny.newBuilder({a : 5}, {b: function() { return 3; }});

    var ev = b.newEvent();
    assert.equal(5, ev.data.a);
    assert.equal(3, ev.data.b);
  });

  it("accepts dict-like arguments to .add()", function() {
    var b = hny.newBuilder();
    var ev = b.newEvent();

    ev.add({ a: 5 });
    assert.equal(5, ev.data.a);

    var ev2 = b.newEvent();
    var map = new Map();
    map.set("a", 5);
    assert.equal(5, ev.data.a);
  });

  it("it toString()'s keys from Maps in .add()", function() {
    var b = hny.newBuilder();
    var ev = b.newEvent();

    var map = new Map();
    map.set({ toString: function() { return "hello"; } }, 5);
    ev.add(map);

    assert.equal(5, ev.data.hello);
  });

  it("converts all values to primitive types in .add/.addField", function() {
    var b = hny.newBuilder();
    var ev;
    var map;

    ev = b.newEvent();
    map = new Map();

    // Object, we JSON.stringify it
    map.set("obj", { a: 1, b : 2 });

    // String converts to a string
    map.set("String", new String("a:1"));
    map.set("string", "a:1");

    // Number converts to a number
    map.set("Number", new Number(5));
    map.set("number", 5);

    // Boolean converts to a boolean
    map.set("Boolean", new Boolean(true));
    map.set("boolean", true);

    // Date does not convert
    map.set("Date", new Date(1,2,3,4,5,6,7));

    // Null/undefined both end up being null in the output
    map.set("null", null);
    map.set("undefined", undefined);

    ev.add(map);
    assert.equal(JSON.stringify(ev.data), '{"obj":\"{\\"a\\":1,\\"b\\":2}\","String":"a:1","string":"a:1","Number":5,"number":5,"Boolean":true,"boolean":true,"Date":"1901-03-03T12:05:06.007Z","null":null,"undefined":null}');
  });
});

import assert from 'assert';
import libhoney from '../lib/libhoney';

var _transmissionConstructorArg = null;
var _transmissionSendEventArg = null;

class MockTransmission {
  constructor(options) {
    _transmissionConstructorArg = options;
  }

  sendEvent (ev) {
    _transmissionSendEventArg = ev;
  }
}

describe('libhoney', function() {
  describe("constructor options", function() {
    it("should be communicated to transmission constructor", function() {
      var options = { a: 1, b: 2, c: 3, d: 4, transmission: MockTransmission };
      var honey = new libhoney(options);

      assert.equal(options.a, _transmissionConstructorArg.a);
      assert.equal(options.b, _transmissionConstructorArg.b);
      assert.equal(options.c, _transmissionConstructorArg.c);
      assert.equal(options.d, _transmissionConstructorArg.d);
    });
  });

  describe("event properties", function() {
    it("should ultimately fallback to hardcoded defaults", function() {
      var honey = new libhoney({
        // these two properties are required
        writeKey: "12345",
        dataset: "testing",
        transmission: MockTransmission
      });
      var postData = { a : 1, b : 2};
      honey.sendEvent({
        data: postData
      });

      assert.equal(_transmissionSendEventArg.apiHost, "https://api.honeycomb.io/");
      assert.equal(_transmissionSendEventArg.writeKey, "12345");
      assert.equal(_transmissionSendEventArg.dataset, "testing");
      assert.equal(_transmissionSendEventArg.sampleRate, 1);
      assert(_transmissionSendEventArg.timestamp instanceof Date);
      assert.equal(_transmissionSendEventArg.postData, JSON.stringify(postData));
    });

    it("should come from libhoney options if not specified in event", function() {
      var honey = new libhoney({
        apiHost: "http://foo/bar",
        writeKey: "12345",
        dataset: "testing",
        transmission: MockTransmission
      });
      var postData = { a : 1, b : 2};
      honey.sendEvent({
        data: postData
      });

      assert.equal(_transmissionSendEventArg.apiHost, "http://foo/bar");
      assert.equal(_transmissionSendEventArg.writeKey, "12345");
      assert.equal(_transmissionSendEventArg.dataset, "testing");
      assert.equal(_transmissionSendEventArg.postData, JSON.stringify(postData));
    });
  });
});

